This torrent has all issues of the short lived Mystique ongoing series. Mystique as usual is playing more than one side, and it is up to the X-Men and others to figure out who she is really with - before it is too late. The shapeshifter Raven Darkholme, as she is named, has been a popular villain and occasional anti-hero since her introduction - which also may be due to her deep ties to characters such as Rogue, Nightcrawler, Gambit and Sabretooth in various interesting ways. Thanks to Zone-Empire for these digital copies, please seed and enjoy! :-)
